stdyInfo.abstract:
        Studiul Sanatatea Reproducerii Romania 2004 este cel de-al patrulea studiu privind sanatatea reproducerii realizat in Romania dupa 1990.

Datele incluse in studiu reprezinta o evaluare a interventiilor din domeniul sanatatii reproducerii in Romania si ajuta la determinarea tendintelor indicatorilor specifici, cu accent pe accesul la serviciile de sanatate, in special cele pentru mama si copil. De asemenea, studiul reprezinta o baza de date esentiala in procesul de stabilire a prioritatilor pentru urmatoarele interventii in sistemul de sanatate si pentru noi programe de asistenta.

O noutate este ca studiul include un capitol special destinat evaluarii serviciilor de sanatate, inclusiv a barierelor cu care se confrunta populatie in utilizarea acestora.

Prezentul studiu a fost proiectat astfel incat sa raspunda urmatoarelor obiective:
- Sa evalueze situatia curenta in ceea ce priveste fertilitatea pentru esantionul de femei, avortul, nevoia de servicii contraceptive si alte aspecte privind sanatatea reproducerii in Romania;
- Sa permita decidentilor politici, responsabililor de programe si cercetatorilor sa evalueze si sa imbunatateasca programele existente si sa dezvolte noi strategii;
- Sa masoare modificarile ratei fertilitatii, prevalentei contraceptiei, alaptarea, utilizarea avortului provocat, accesibilitatea si utilizarea serviciilor de planificare familiala si sa studieze factorii care influenteaza aceste schimbari;
- Sa masoare accesul la serviciile de sanatate, cu accent pe serviciile din asistenta primara, in mod particular impactul dezvoltarii serviciilor de sanatate reproductiva in ultimii cinci ani;
- Sa actualizeze datele privind cunostintele, atitudinile si comportamentul tinerilor in varsta de 15-24 de ani, legat de sanatatea reproducerii;
- Sa furnizeze informatii asupra nivelului de cunostinte privind transmiterea si prevenirea ITS, inclusiv HIV/SIDA si asupra atitudinii fata de persoanele infectate HIV/SIDA (stigmatizare si discriminare);
- Sa ofere informatii despre violenta in familie si sa identifice factorii determinanti pentru abuzul verbal, fizic si sexual;
- Sa identifice grupele de risc si sa directioneze viitoarele studii de sanatate a reproducerii catre grupele avand un comportament reproductiv cu risc crescut.
